    console.log(props)
    return(
        <div className={styles.container}>
          <Grid spacing={3} justify="center">
            <Grid itme component={Card}>
                <CardContent>
                    <Typography>
                    </Typography>
                </CardContent>
            </Grid>
          </Grid>
        </div>
    )
}

export default Cards;
